import React from "react";
import {Jumbotron, Carousel, Button, Accordion, Card} from 'react-bootstrap';

// use cards as components for project
function Products() {
  return (
    <div className="products">
      <div class="container">
      <Jumbotron>
        <h1>Looking for the best cloud storage on the market?</h1>
        <p>Look no further</p>

      </Jumbotron>

      </div>
    </div>
  );
}

export default Products;
